ControlPropertyState.AutoRuleBindingString:
If(
    !IsEmpty(
        Filter(
            TramitesSolicitudes,
            Codigo = drpEmpleadoHorario.Selected.Codigo && Fecha_Inicio <= dpFechaFin.SelectedDate && Fecha_Fin >= dpFechaInicio.SelectedDate && EstadoDeProceso = "Aprobado"
        )
    ),
    UpdateContext({Advertencia: true}),
    false
);
